window.bookSummaryJSON = "<p>It seems like it's going to be just another normal Peterson family trip for haircuts - that is until Charles meets Princess, a spoiled but irresistible Yorkie pup. She belongs to one of the stylists but Princess's owner is moving and can't take the puppy with her. Charles volunteers to care for Princess until they find her a new home. But it doesn't take long for the Petersons to get tired of Princess's privileged ways. How will Charles ever find the right family for this high maintenance pup? </p>"; 
